INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 0, 8, 5118061, 2834, 40, "ペコリーヌとの出会い", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2, 7, "青空の下で謁見", 20063115, 10118, "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 0, 8, 5118062, 2835, 40, "マホとの出会い", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2, 7, "未来の騎空団\nマスコット？", 20063115, 10118, "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 0, 8, 5118063, 2837, 40, "アキノとの出会い", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2, 7, "お嬢さまからの\n緊急依頼", 20063115, 10118, "ランドソル市街地", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 0, 8, 5118064, 4108402, 40, "ジュンとの出会い", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 2, 18, "黄金色の悩みごと", 20063115, 10118, "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 0, 8, 5118065, 4107402, 40, "カオリとの出会い", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 2, 18, "白熱！　格闘大会！", 20063115, 10118, "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 1, 8, 5118066, 9000227, 40, "ニノンとの出会い", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 2, 16, "祭り太鼓はオーエドの華", 20063115, 10118, "オーエド町", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 0, 8, 5118067, 2101181, 40, "スズナとの出会い", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 3, 19, "人気者は遅れて\nやってくる", 20063115, 10118, "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 0, 8, 5118068, 4109402, 40, "ナナカとの出会い", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 3, 18, "巫女・ミーツ・魔法少女", 20063115, 10118, "ランドソル市街地", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 0, 8, 5118069, 4305402, 40, "キャル＆コッコロとの出会い", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 3, 18, "ネズ耳は二度なくなる", 20063115, 10118, "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 0, 8, 5118070, 4101402, 40, "ユカリとの出会い", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 3, 18, "この出会いにカンパイ！", 20063115, 10118, "ランドソル市街地", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 0, 8, 5118071, 4106402, 40, "アオイとの出会い", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 3, 18, "陰陽アンサンブル", 20063115, 10118, "ランドソル市街地", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 1, 8, 5118072, 2836, 40, "シノブとの出会い", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 3, 7, "運試し十番勝負！", 20063115, 10118, "フリーマーケット会場", 91002);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (0, 0, 0, 5118600, 0, 0, "オープニング", 0, 1, 0, "彼女たちの新たな日常", 20063115, 10118, 0, 0);
